import React from 'react';
import { Card, CardTitle } from 'reactstrap';

const Search = () => {
	return (
		<Card className='page'>
			<CardTitle className='search-box'>
				<input type="text" />
			</CardTitle>
			<MovieList title='Kết quả tìm kiếm' />

		</Card >
	);
};

export default Search;
